import { Injectable } from '@angular/core';
import { HTTP } from '@ionic-native/http/ngx';
import { Observable, throwError } from 'rxjs';
import { retry, catchError } from 'rxjs/operators';
import { Base64 } from '@ionic-native/base64/ngx';
import { environment} from '../../environments/environment';
import { HttpClient, HttpHeaders, HttpErrorResponse } from '@angular/common/http';
import { ToastService } from '../services/toast.service';



@Injectable({
  providedIn: 'root'
})
export class RestClientService {

    // tslint:disable-next-line:variable-name
    private base_path = 'https://speech.googleapis.com/v1p1beta1/speech:recognize';

    constructor(private http: HttpClient, private base64: Base64, private toastService: ToastService) { }

    httpOptions = {
        headers: new HttpHeaders({
            'Content-Type': 'application/json'
        })
    };

    postdata = {
        audio: {
            // tslint:disable-next-line:max-line-length
            content: ''

        },
        config: {
            encoding: 'FLAC',
            sampleRateHertz: 16000,
            languageCode: 'fr-FR'
        }
    };


    RecognizeGoogleApi() {
        this.Post_recognizeSpeech();
        // this.postItem();
    }

    convert_audio_to_base64() {
        const filePath = '../../../resources/audio/audio.wav';
        this.base64.encodeFile(filePath).then((base64File: string) => {
            console.log(base64File);
            this.toastService.showToast(base64File, 'success');
        }, (err) => {
            this.toastService.showToast(err, 'danger');
        });
    }

    display_each_sentence(speech: any) {
        console.log(speech)
        for (const speaker of speech) {
            console.log(speaker['alternatives'][0]['transcript']);
        }
    }
    // Get single student data by ID
    Post_recognizeSpeech() {
        console.log('Start Google Speech...');
        // tslint:disable-next-line:max-line-length prefer-const
        let data: Observable<any>;
        let item: any;
        // tslint:disable-next-line:no-shadowed-variable max-line-length
        this.http.post(this.base_path + '?key=' + environment.google_api.apiKey, this.postdata, this.httpOptions).subscribe(data => {
            item = data;
            console.log(data);
            // console.log(data['results'][0]['alternatives'][0]['transcript']);
            this.toastService.showToast(data['results'][0]['alternatives'][0]['transcript'], null);
            console.log('Pas d erreur');
            this.display_each_sentence(data['results']);
            return data;

        }, error => {
            console.log(error);
            console.log('Erreur');
        });
    }

}
